Recall that subtracting a negative is the same as adding a positive, so the given expression becomes \[(6a^3+92a^2-7)+(7a^3-a^2+7).\]Combining like terms, we get \begin{align*}
(6a^3+92a^2-7)+(7a^3-a^2+7) &= (6a^3+7a^3)+(92a^2-a^2)+(-7+7) \\
&= 13a^3+91a^2+0 \\
&= \boxed{13a^3+91a^2}.
\end{align*}
